import React from 'react'
import todosData from './todosData';
function TodoItem(props){
    return(
        <div className="todo-item">
            <input type="checkbox" checked={props.todo.completed}/>
            <p>{props.todo.text}</p>
        </div>
    )
}


export default TodoItem;
